import React from "react";
import "./Sidebar.css";
import { CDBSidebar, CDBSidebarContent, CDBSidebarMenu } from "cdbreact";
import { NavLink } from "react-router-dom";
import BarChartIcon from "@mui/icons-material/BarChart";
import AssignmentIcon from "@mui/icons-material/Assignment";
import LogoutIcon from "@mui/icons-material/Logout";

const Sidebar = () => {
  return (
    <div
      style={{ display: "flex", height: "100vh", overflow: "scroll initial" }}
    >
      <CDBSidebar className="sidebar_main">
        <CDBSidebarContent className="sidebar_content">
          <CDBSidebarMenu>
            <div><NavLink exact to="/paymentspage" activeClassName="activeMenuItem" className="inactiveMenuItem">
              <BarChartIcon />
              Payments
            </NavLink></div>
            <div><NavLink exact to="/paymentspage" activeClassName="activeMenuItem" className="inactiveMenuItem">
              <BarChartIcon />
              Profile
            </NavLink></div>
            <div><NavLink exact to="/paymentspage" activeClassName="activeMenuItem" className="inactiveMenuItem">
              <BarChartIcon />
              Receipts
            </NavLink></div>
            <div><NavLink exact to="/paymentspage" activeClassName="activeMenuItem" className="inactiveMenuItem">
              <AssignmentIcon />
              Help
            </NavLink></div>
            <div><NavLink exact to="/paymentspage" activeClassName="activeMenuItem" className="inactiveMenuItem">
              <LogoutIcon/>Logout
            </NavLink></div>
          </CDBSidebarMenu>
        </CDBSidebarContent>
      </CDBSidebar>
    </div>
  );
};

export default Sidebar;
